import { Container, Row, Col } from "react-bootstrap";

function FilmsContainer() {

}

function FilmDiv() {
  return (
    <div className="dataDiv">
      <Row>
        <Col>gradeavg</Col>
        <Col>TITLE</Col>
        <Col>year</Col>
        <Col>description</Col>
      </Row>
    </div>
  )
}


function Films() {
    return (
      <Container fluid>
        <h1>Films</h1>
        <FilmsContainer/>
      </Container>
    )
  }


export default Films;
